import { generateAuthActions } from "redux-token-auth";

const config = {
  authUrl: "afrosiyob",
};

const {
  registerUser,
  signInUser,
  signOutUser,
  verifyCredentials,
} = generateAuthActions(config);

export { registerUser, signInUser, signOutUser, verifyCredentials };
